// Detail.js
import React from 'react';
import { useParams } from 'react-router-dom';
import { dummyData } from './dummyData';

function Detail() {
  const { id } = useParams();
  const data = dummyData.result; // 실제로는 id를 이용해 데이터를 가져와야 함

  if (data.stationChargerId !== id) {
    return <div>데이터를 찾을 수 없습니다.</div>;
  }

  return (
    <div className="detail">
      <h1>{data.name}</h1>
      <p>{data.address}</p>
      <p>운영자: {data.operatorName}</p>
      <p>출력: {data.output}</p>
      <p>종류: {data.chargerTypeName}</p>
      <p>업데이트 날짜: {data.updatedAt}</p>
    </div>
  );
}

export default Detail;
